import React from 'react';
import Button from '@material-ui/core/Button';
import Done from '@material-ui/icons/Done';

const TaskDoneIcon = (props)=> {

    return (
        <div>

                startIcon={<Done color="primary" />}
          
        </div>
    );
}
export default TaskDoneIcon
